import "./App.css";
import DataTableScene from "./scene/DataTableScene";
import Container from "@material-ui/core/Container";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import Box from "@material-ui/core/Box";
import Divider from "@material-ui/core/Divider";
import Avatar from "@material-ui/core/Avatar";

import MetricRow from "./components/main-page-metrics/MetricRow";
function App() {
  return (
    <div className="App">
      <AppBar position="static">
        <Toolbar> </Toolbar>
      </AppBar>

      <Container maxWidth="xl">
        <Box padding="32px 16px">
          <Typography
            variant="h5"
            style={{ textAlign: "left", display: "flex" }}
          >
            <Avatar />
            <span style={{ fontWeight: "bold" }}>Welcome Back, </span> Miranda!
          </Typography>
          <Typography
            variant="body2"
            style={{ textAlign: "left" }}
            color="text.primary"
          >
            Premium user
          </Typography>
        </Box>{" "}
        <Divider />
        <Box padding="24px 16px">
          <MetricRow />
        </Box>
        <Divider />
        <DataTableScene />
      </Container>
    </div>
  );
}

export default App;
